import React from 'react';
import './buttonGroup.css';
import { Button } from 'semantic-ui-react';

const ButtonGroup = () => {

  <div className = 'MediaButton'>
    <Button.Group>
      <Button>Media</Button>
      <Button>Contacts</Button>
    </Button.Group>
  </div>

}

export default ButtonGroup;
